import React from "react";

const trabajos = [
  { id: 1, nombre: "Semipermanente", descripcion: "Uñas con gel y diseño minimalista.", imagen: "https://via.placeholder.com/150" },
  { id: 2, nombre: "Softgel", descripcion: "Duración 3 semanas.", imagen: "https://via.placeholder.com/150" },
  { id: 3, nombre: "Nail Art Creativo", descripcion: "Diseños personalizados y únicos.", imagen: "https://via.placeholder.com/150" },
  {id: 4, nombre: "Kapping con soft gel", descripcion: "Relajación y cuidado para tus pies.", imagen: "https://via.placeholder.com/150" },
];

export default function WorksSection() {
  return (
    <div className="section">
      <h2>Trabajos realizados</h2>
      <div className="works-grid">
        {trabajos.map((t) => (
          <div key={t.id} className="work-card">
            <img src={t.imagen} alt={t.nombre} style={{ width: "100%", borderRadius: "8px" }} />
            <h3>{t.nombre}</h3>
            <p>{t.descripcion}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
